import { useSelector } from "react-redux";
import PublicLayOut from "../Component/PublicComponent/PublicLayOut";
import Loader from "../Loader/Loader";
import Login from "../Login/Login";
import Registration from "../Login/Registration";

const loaderStatus = useSelector((state: any) => state.loaderStatus);
export const RouteObjects = [
  {
    path: "/",
    element: loaderStatus==true?<Loader/>:<PublicLayOut />,
    children: [
      // { index: true, element: <Index /> },
      {
        path: "/Registration",
        element: <Registration />
      },

      {
        path: "/Login",
        element: <Login />
      }
    ]
  },
  { path: "*", element: <p>There's nothing here!</p> }
];
